//import logo from './logo.svg';
import './App.css';

function Header() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>HEADET</h1>
        <nav>
        <img class="logo" src="assets/logo.png" alt="" />
        <a href="main.html"><div class="nav_logo">Dormnet</div></a>
        <ul class="nav_links">
            <li class="link"><a href="#client">About Us</a></li>
            <li class="link"><a href="listing_a.html">List your Dorm</a></li>
            <li class="link"><a href="dashboard.html">Account</a></li>
            
        </ul>
    </nav>

      </header>
    </div>
  );
}

export default Header;
